// src/components/Stats.js
import React from 'react';

const Stats = () => {
  return (
    <div style={{ padding: '20px' }}>
      <h1>Show Stats/Insights</h1>
      <p>Here you can view stats and insights about your runs.</p>
      <p>This is a test to see how this thing works.</p>
    </div>
  );
};

export default Stats;
